syntax = "proto3";

import "ActiveCenter.proto";
import "CommonTaskInfo.proto";
import "FloatStrategy.proto";
import "MissionInfo.proto";

message DataRes {
    int32 is_new_user = 1;
    string active_url = 3;
    repeated MissionInfo mission_list = 4;
    repeated FloatStrategy float_list = 5;
    string newuser_pop_clickurl = 6;
    string newuser_pop_money = 7;
    string newuser_pop_top = 8;
    ActiveCenter active_center = 9;
    repeated CommonTaskInfo task_list = 11;
}
